                                        <p class="mb0">In Lonato ist es am Morgen grau und es bleibt neblig bei Temperaturen von 3°C. Am Mittag wird die Sonne von einzelnen Wolken verdeckt bei Höchstwerten von 11°C. Abends ist es in Lonato vielfach wolkig bei Werten von 7 bis zu 8°C. In der Nacht ist es überwiegend dicht bewölkt bei Tiefsttemperaturen von 6°C.  Mit Böen zwischen 8 und 14 km/h ist zu rechnen.</p>
